import React from "react";
import "./App.css";
import hanldeSubmit from "./buttonHandler.js";


function App() {
  return (
    <div className="app-container">
      <h1>
        ever dreamed about shortenning a url?
      </h1>
      <div className="box">
        <h2 className="enter-url">
          please enter an URL:
        </h2>
        <input
          type="text"
          placeholder="original URL..."
          className="url-input"
        />
        <button
        type="submit"
        className="submit-btn"
        onClick={hanldeSubmit}
        >
          <span>convert url</span>
        </button>
      </div>
      <footer>
        @ all rights reserved to guy harpaz @
      </footer>
    </div>
  );
}

export default App;
